import React from 'react';

function RouteInstructions({ routeStats }) {
  if (!routeStats) return null;

  return (
    <div className="route-summary-card">
      <div className="stats-container">
        <div className="stat-box distance-box">
          <span className="stat-label">DISTANCE</span>
          <span className="stat-value distance-value">{routeStats.distance_km.toFixed(2)} km</span>
        </div>
        <div className="stat-box time-box">
          <span className="stat-label">TIME</span>
          <span className="stat-value time-value">{Math.round(routeStats.time_min)} min</span>
        </div>
      </div>
    </div>
  );
}

export default RouteInstructions;
